import { View, Text } from 'react-native'
import React from 'react'

const FindHunts = ({navigation}) => {
  return (
    <View>
      <StandardButton 
          title='Hunt Info'
          onPress={() => {
            navigation.navigate('HuntInfo')
          }}
        />
    </View>
  )
}

export default FindHunts
